import os
import sys
import json
import yaml
import base64
import zlib
import tempfile
from pathlib import Path
from datetime import datetime
from typing import Dict, List, Optional, Any

# ============================================================================
# EMBEDDED SYSTEM DATA
# ============================================================================


EMBEDDED_CONFIGS = ""

def load_configurations():
    """Load all embedded configurations"""
    data = json.loads(zlib.decompress(base64.b64decode(EMBEDDED_CONFIGS)))
    configs = {}
    for name, info in data.items():
        if info['type'] == 'yaml':
            configs[name] = yaml.safe_load(info['content'])
        else:
            configs[name] = json.loads(info['content'])
    return configs


EMBEDDED_MODULES = ""

def extract_modules():
    """Extract and load all embedded Python modules"""
    data = json.loads(zlib.decompress(base64.b64decode(EMBEDDED_MODULES)))

    # Create temporary directory structure
    temp_dir = Path(tempfile.mkdtemp(prefix="ncos_"))

    for module_path, content in data.items():
        full_path = temp_dir / module_path
        full_path.parent.mkdir(parents=True, exist_ok=True)
        full_path.write_text(content)

    # Add to Python path
    sys.path.insert(0, str(temp_dir))

    return temp_dir


EMBEDDED_KNOWLEDGE = ""

def load_knowledge_base():
    """Load all embedded knowledge base files"""
    return json.loads(zlib.decompress(base64.b64decode(EMBEDDED_KNOWLEDGE)))


# ============================================================================
# NCOS RUNTIME SYSTEM
# ============================================================================

class NCOSRuntime:
    """Main runtime system for NCOS v21.7 Phoenix Mesh"""

    def __init__(self):
        self.configs = {}
        self.modules_path = None
        self.knowledge = {}
        self.orchestrator = None

    def initialize(self):
        """Initialize the complete NCOS system"""
        print("🚀 Initializing NCOS v21.7 Phoenix Mesh...")

        # Load configurations
        print("📋 Loading configurations...")
        self.configs = load_configurations()

        # Extract modules
        print("🐍 Extracting system modules...")
        self.modules_path = extract_modules()

        # Load knowledge base
        print("📚 Loading knowledge base...")
        self.knowledge = load_knowledge_base()

        # Initialize orchestrator
        print("🎯 Initializing orchestrator...")
        self._initialize_orchestrator()

        print("✅ NCOS system ready!")

    def _initialize_orchestrator(self):
        """Initialize the main orchestrator"""
        try:
            # Import the orchestrator module
            sys.path.insert(0, str(self.modules_path / "core"))
            from orchestrator import Orchestrator
            self.orchestrator = Orchestrator(self.configs)
        except ImportError:
            print("⚠️ Using fallback orchestrator")
            self.orchestrator = self._create_fallback_orchestrator()

    def _create_fallback_orchestrator(self):
        """Create a fallback orchestrator if main fails"""
        class FallbackOrchestrator:
            def __init__(self, configs):
                self.configs = configs

            def run(self):
                print("Running in fallback mode...")
                print(f"Loaded {len(self.configs)} configurations")

        return FallbackOrchestrator(self.configs)

    def run(self, mode="interactive"):
        """Run the NCOS system"""
        if mode == "interactive":
            self._run_interactive()
        elif mode == "server":
            self._run_server()
        elif mode == "backtest":
            self._run_backtest()

    def _run_interactive(self):
        """Run in interactive mode"""
        print("\n🤖 NCOS Interactive Mode")
        print("=" * 50)

        while True:
            try:
                command = input("\nNCOS> ").strip()

                if command.lower() in ['exit', 'quit']:
                    print("👋 Goodbye!")
                    break
                elif command == 'status':
                    self._show_status()
                elif command == 'configs':
                    self._show_configs()
                elif command == 'knowledge':
                    self._show_knowledge()
                elif command.startswith('run '):
                    self._execute_command(command[4:])
                else:
                    print(f"Unknown command: {command}")
                    print("Commands: status, configs, knowledge, run <strategy>, exit")
            except KeyboardInterrupt:
                print("\n👋 Goodbye!")
                break

    def _show_status(self):
        """Show system status"""
        print("\n📊 System Status")
        print(f"Configurations loaded: {len(self.configs)}")
        print(f"Knowledge files: {len(self.knowledge)}")
        print(f"Modules path: {self.modules_path}")
        print(f"Orchestrator: {'Active' if self.orchestrator else 'Not initialized'}")

    def _show_configs(self):
        """Show loaded configurations"""
        print("\n📋 Loaded Configurations:")
        for name in sorted(self.configs.keys()):
            print(f"  - {name}")

    def _show_knowledge(self):
        """Show knowledge base files"""
        print("\n📚 Knowledge Base:")
        for name in sorted(self.knowledge.keys()):
            print(f"  - {name} ({len(self.knowledge[name])} chars)")

    def _execute_command(self, command):
        """Execute a specific command"""
        print(f"Executing: {command}")
        if self.orchestrator:
            # Delegate to orchestrator
            try:
                result = self.orchestrator.execute(command)
                print(f"Result: {result}")
            except Exception as e:
                print(f"Error: {e}")
        else:
            print("Orchestrator not available")

    def _run_server(self):
        """Run as API server"""
        print("🌐 Starting NCOS API Server...")
        # Server implementation would go here

    def _run_backtest(self):
        """Run backtesting mode"""
        print("📈 Starting NCOS Backtesting...")
        # Backtesting implementation would go here

# ============================================================================
# MAIN ENTRY POINT
# ============================================================================

def main():
    """Main entry point for NCOS v21.7"""
    import argparse

    parser = argparse.ArgumentParser(
        description="NCOS v21.7 Phoenix Mesh - Trading Intelligence System"
    )
    parser.add_argument(
        '--mode', 
        choices=['interactive', 'server', 'backtest', 'extract'],
        default='interactive',
        help='Execution mode'
    )
    parser.add_argument(
        '--extract-to',
        help='Extract all embedded files to directory'
    )

    args = parser.parse_args()

    if args.mode == 'extract' and args.extract_to:
        # Extract mode - dump all files
        extract_path = Path(args.extract_to)
        extract_path.mkdir(exist_ok=True)

        print(f"📦 Extracting NCOS to {extract_path}...")

        # Extract configurations
        configs = load_configurations()
        (extract_path / "configs").mkdir(exist_ok=True)
        for name, config in configs.items():
            (extract_path / "configs" / name).write_text(
                yaml.dump(config) if name.endswith('.yaml') else json.dumps(config, indent=2)
            )

        # Extract modules
        modules_data = json.loads(zlib.decompress(base64.b64decode(EMBEDDED_MODULES)))
        for module_path, content in modules_data.items():
            full_path = extract_path / module_path
            full_path.parent.mkdir(parents=True, exist_ok=True)
            full_path.write_text(content)

        # Extract knowledge
        knowledge = load_knowledge_base()
        (extract_path / "knowledge").mkdir(exist_ok=True)
        for name, content in knowledge.items():
            (extract_path / "knowledge" / name).write_text(content)

        print("✅ Extraction complete!")
    else:
        # Normal execution
        runtime = NCOSRuntime()
        runtime.initialize()
        runtime.run(mode=args.mode)

if __name__ == "__main__":
    main()
